import { Injectable } from '@angular/core';
import { HospitalisationDepuitLaDernierVisite } from '../models/HospitalisationDepuitLaDernierVisite';
import { HttpClient, HttpResponse } from '@angular/common/http';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class HospitdepvisiteService {
  private apiUrl = 'https://localhost:7129/api/HospitalisationDepuitLaDernierVisites';

  constructor(private http: HttpClient) { }

  addhospitalisation(hospitalisationDepuitLaDernierVisite: HospitalisationDepuitLaDernierVisite): Observable<any> {
    console.log('Creating it with data:', hospitalisationDepuitLaDernierVisite);
    return this.http.post<any>(`${this.apiUrl}/addhospitalisation`, hospitalisationDepuitLaDernierVisite, { observe: 'response' });
}

getById(id: number): Observable<HospitalisationDepuitLaDernierVisite> {
  return this.http.get<any>(`${this.apiUrl}/${id}`);
}

update(id: number, HospitalisationDepuitLaDernierVisite: HospitalisationDepuitLaDernierVisite): Observable<any> {
  return this.http.put(`${this.apiUrl}/update/${id}`, HospitalisationDepuitLaDernierVisite, { observe: 'response' });
}
}
